i_max:"الحد الأقصى للرموز لتوليد. إجمالي طول الرموز المدخلة والرموز المولدة محدود بطول سياق النموذج.",com_endpoint_openai_topp:"بديل للعينة مع درجة الحرارة، يسمى العينة النووية، حيث ينظر النموذج في نتائج الرموز مع كتلة احتمال top_p. لذا 0.1 يعني أن الرموز التي تشكل فقط 10% من كتلة الاحتمال تعتبر. نوصي بتغيير هذا أو درجة الحرارة ولكن ليس كلاهما.",com_endpoint_openai_freq:"رقم بين -2.0 و 2.0. القيم الموجبة تعاقب الرموز الجديدة بناءً على تكرارها الحالي في النص حتى الآن، مما يقلل من احتمالية تكرار النموذج لنفس السطر حرفيًا.",com_endpoint_openai_pres:"رقم بين -2.0 و 2.0. القيم الموجبة تعاقب الرموز الجديدة بناءً على ما إذا كانت تظهر في النص حتى الآن، مما يزيد احتمالية النموذج للحديث عن مواضيع جديدة.",com_endpoint_openai_custom_name_placeholder:"قم بتعيين اسم مخصص لـ ChatGPT",com_endpoint_openai_prompt_prefix_placeholder:"قم بتعيين تعليمات مخصصة لتضمينها في رسالة النظام. الافتراضي: لا شيء",com_endpoint_anthropic_temp:"المدى من 0 إلى 1. استخدم درجة الحرارة الأقرب إلى 0 للمهام التحليلية / اختيارية متعددة، وأقرب إلى 1 للمهام الإبداعية والإنشائية. نوصي بتغيير هذا أو Top P ولكن ليس كلاهما.",com_endpoint_anthropic_topp:"Top-p يغير الطريقة التي يختار فيها النموذج الرموز للإخراج. يتم اختيار الرموز من الأكثر احتمالية k (انظر المعلمة topK) إلى الأقل حتى يساوي مجموع احتمالاتهم قيمة top-p.",com_endpoint_anthropic_topk:"يغير top-k الطريقة التي يختار فيها النموذج الرموز للإخراج. يعني top-k 1 أن الرمز المحدد هو الأكثر احتمالية من بين جميع الرموز في المفردات النموذجية (يسمى أيضا الترميز الطمع)، بينما يعني top-k من 3 أن الرمز القادم محدد من بين الرموز الثلاثة الأكثر احتمالية (باستخدام درجة الحرارة).",com_endpoint_anthropic_maxoutputtokens:"العدد الأقصى من الرموز التي يمكن إنشاؤها في الرد. حدد قيمة أقل للحصول على ردود أقصر وقيمة أعلى للحصول على ردود أطول.",com_endpoint_anthropic_custom_name_placeholder:"قم بتعيين اسم مخصص لـ Anthropic",com_endpoint_frequency_penalty:"عقوبة التكرار",com_endpoint_presence_penalty:"عقوبة الوجود",com_endpoint_plug_use_functions:"استخدام الوظائف",com_endpoint_pl