_empty:"初始值：空",com_endpoint_default_with_num:"初始值：{0}",com_endpoint_context:"上下文",com_endpoint_tone_style:"语气",com_endpoint_token_count:"词元数",com_endpoint_output:"输出",com_endpoint_context_tokens:"最大上下文词元数",com_endpoint_context_info:`可用于上下文的最大词元数。用于控制每个请求发送的词元数量。
  如果未指定，将根据已知模型的上下文大小使用系统默认值。设置较高的值可能会导致错误和/或更高的词元成本。`,com_endpoint_google_temp:"值越高表示输出越随机，值越低表示输出越确定。建议不要同时改变此值和 Top-p。",com_endpoint_google_topp:"top-p（核采样）会改变模型选择输出词的方式。从概率最大的 K（参见topK参数）向最小的 K 选择，直到它们的概率之和等于 top-p 值。",com_endpoint_google_topk:"top-k 会改变模型选择输出词的方式。top-k 为 1 意味着所选词是模型词汇中概率最大的（也称为贪心解码），而 top-k 为 3 意味着下一个词是从 3 个概率最大的词中选出的（使用随机性）。",com_endpoint_google_maxoutputtokens:"响应中可以生成的最大令牌数。指定较低的值以获得较短的响应，指定较高的值以获得较长的响应。注意：模型可能会在达到此最大值之前停止。",com_endpoint_google_custom_name_placeholder:"为 Google 设置一个名称",com_endpoint_prompt_prefix_placeholder:"自定义指令和上下文，默认为空。",com_endpoint_instructions_assistants_placeholder:"覆盖助手的指令。这对于需要逐次修改行为非常有用。",com_endpoint_prompt_prefix_assistants_placeholder:"在助手的主要指令之上设置额外的指令或上下文。如果为空，则忽略。",com_endpoint_custom_name:"自定义名称",com_endpoint_prompt_prefix:"自定义指令",com_endpoint_prompt_prefix_assistants:"额外指令",com_endpoint_instructions_assistants:"覆写指令",com_endpoint_temperature:"随机性",com_endpoint_default:"初始值",com_endpoint_top_p:"Top P",com_endpoint_top_k:"Top K",com_endpoint_max_output_tokens:"最大输出词元数",com_endpoint_stop:"停止序列",com_endpoint_stop_placeholder:"按 `Enter` 键分隔多个值",com_endpoint_openai_max_tokens:"可选的 `max_tokens` 字段，表示在聊天补全中可生成的最大词元数量。\n\n    输入词元和生成词元的总长度受模型上下文长度的限制。如果该数值超过最大上下文词元数，您可能会遇到错误。",com_endpoint_openai_temp:"值越高表示输出越随机，值越低表示输出越确定。建议不要同时改变此值和 Top P。",com_endpoint_openai_max:"最大生成词元数。输入词元长度由模型的上下文长度决定。",com_endpoint_openai_topp:"相较于随机性的另一个取样方法，称为核采样，模型选取输出词元中大于 top_p（概率密度在整个概率分布中的比例）的结果。比如 top_p=0.1 表示只有概率占比为前 10% 的词元才会被考虑作为输出。建议不要同时改变此值和随机性。",com_endpoint_openai_freq:"值介于 -2.0 到 2.0 之间。正值将惩罚当前已频繁使用的词元，从而降低重复用词的可能性。",com_endpoint_openai_pres:"值介于 -2.0 到 2.0 之间。正值将惩罚当前已经使用的词元，从而增加讨论新话题的可能性。",com_endpoint_openai_resend:"重新发送所有先前附加的图像。注意：这会显着增加词元成本，并且可能会遇到很多关于图像附件的错误。",com_endpoint_openai_resend_files:"重新发送所有先前附加的文件。注意：这会显着增加词元成本，并且可能会遇到很多关于图像附件的错误。",com_endpoint_openai_detail:"发送给Vision的图像分辨率。 “Low” 更便宜且更快，“High” 更详细但更昂贵，“Auto” 将基于图像分辨率自动在两者之间进行选择。",com_endpoint_openai_stop:"最多 4 个序列，API 将停止生成更多词元。",com_endpoint_openai_custo